import "../App.css";
import img from '../downtown.jpg.webp';

function AboutPage() {
  return (
    <div className="App">

      <div className="town">
        <div>
          <img src={img} alt="my picture" width="100%" />
        </div>
      </div>
      <h1>About this App</h1>
      <p>
        This App was created as a part of the MCDA5510 course, focused on
        React. This educational app is designed to help students
        learn how to create a React application and gain hands-on experience in
        building a web-based project.
      </p>
    </div>
  );
}

export default AboutPage;
